import React, { Component } from "react";
import Container from "../Container";



class Login extends Component {
    state = {
        email: "",
        password: "",
    }
    handleInputChange = event => {
        const { name, value } = event.target;
        this.setState({
            [name]: value
        });
    };


    render() {

        return (
            <div>
                <Container>
                    <form>
                        <div class="form-group">
                            <label for="exampleFormControlInput1">Enter Email</label>
                            <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="name@example.com" />
                        </div>
                        <div class="form-group">
                            <label for="exampleFormControlInput1">Email Password</label>
                            <input type="password" class="form-control" id="exampleFormControlInput1" placeholder="name@example.com" />
                        </div>

                    </form>
                </Container>
            </div>
        )
    }
}

export default Login;
